import React from 'react';
import Template from './Templates/Simple';
import CvForm from './CvForm/CvForm';
import styled from 'styled-components';


const Half = styled.div`
  width: 45%;
  display: flex;
  flex-direct: row;
`


const App = () => {
    return (
        <Half>
            <CvForm/>
            <Template/>
        </Half>
    )
  }

export default App;
